/**
 * 
 */
import axios from "axios";
const REST_API_BASE_URL = 'http://localhost:8080/';

export const listManagers = () => {
    return axios.get(REST_API_BASE_URL + "api/admin/getAllManagers");
}

export const listEmployees = () => {
    return axios.get(REST_API_BASE_URL + "api/admin/getEmployees");
}

export const listEmployeesLeaveRequests = () => {
    return axios.get(REST_API_BASE_URL + "api/admin/getEmployeeLeaveRequestsReport");
}

export const listEmployeesExitRequests = () => {
    return axios.get(REST_API_BASE_URL + "api/admin/getEmployeeExitRequestsReport");
}

export const getuserDetails = (email) => {
    return axios.get(`${REST_API_BASE_URL}api/admin/getuserDetails?email=${email}`);
}
